import './App.css';
import {useState} from 'react';
import {Note} from "./Note.js";

export default function App(props) {
  const [notes, setNotes] = useState(props.notes)
  return (
    <div>
      <h1>Notes</h1>
      <ol>
        {notes.map((note)=>(
          <Note key={note.id} {...note} />
        ))}
        <input type='text'/>
      </ol>
    </div>
  )
}
